import './App.css';
import {useState} from "react"

function App() {

const [nombre, setNombre] = useState ("");
const [edad, setEdad] = useState (0);
const [pais, setPais] = useState ("");
const [cargo, setCargo] = useState ("");
const [year, setYear] = useState (0);

  return (
    <div className="App">
      <h1>Formulario</h1>
      <div className="datos">
        <label>
          Nombre:
          <input onChange={(event) => {
            setNombre(event.target)
          }} type="text" />
        </label>
        <br />
        <label>
          Edad:
          <input type="number" />
        </label>
        <br />
        <label>
          Pain:
          <input type="text" />
        </label>
        <br />
        <label>
          Cargo:
          <input type="text" />
        </label>
        <br />
        <label>
          Years:
          <input type="number" />
        </label>
        <br />
        <button>Add</button>
      </div>
    </div>
  );
}

export default App;
